$.validator.addMethod('password', function (value) {
    return /^(?=.*[a-z])(?=.*[A-Z])(?=.*\d)[a-zA-Z\d]{8,}$/.test(value);
}, 'Password must contain at least eight characters, one uppercase letter, one lowercase letter and one number');

app.addValidation = function (form, rules, messages) {
    form.validate({
        rules: rules,
        messages: messages,
        errorElement: "em",
        errorPlacement: function (error, element) {
            element = element.parent();
            if (element.hasClass('checkbox') || element.hasClass('radio') || element.hasClass('input-group')) {
                element = element.parent();
            }
            element.append(error);
        },
        highlight: function (element, errorClass, validClass) {
            $(element).parents(".form-group").addClass("theme-danger").removeClass("theme-success");
        },
        unhighlight: function (element, errorClass, validClass) {
            $(element).parents(".form-group").addClass("theme-success").removeClass("theme-danger");
        }
    });
    form.on('change', 'input, textarea, select', function () {
        $(this).valid();
    });
};
var app = app || {};

app.disableHtmlScroll = function () {
    if (app.htmlOverflowEnabled) {
        var initWidth = app.body.outerWidth();
        var initHeight = app.body.outerHeight();
        var scrollPosition = [
            self.pageXOffset || document.documentElement.scrollLeft || document.body.scrollLeft,
            self.pageYOffset || document.documentElement.scrollTop || document.body.scrollTop
        ];
        app.html.data('scroll-position', scrollPosition);
        app.html.data('previous-overflow', app.html.css('overflow'));
        app.html.css('overflow', 'hidden');
        window.scrollTo(scrollPosition[0], scrollPosition[1]);
        var marginR = app.body.outerWidth() - initWidth;
        var marginB = app.body.outerHeight() - initHeight;
        app.body.css({ 'margin-right': marginR, 'margin-bottom': marginB });

        var headerFooterTag = 'padding-right';
        if (app.main.hasClass('right-open')) {
            app.right.css({
                'max-width': app.right.outerWidth() + marginR,
                'padding-right': marginR
            });
            headerFooterTag = 'right';
        }
        app.header.css(headerFooterTag, marginR);
        if (app.main.hasClass('footer-fixed')) {
            app.footer.css(headerFooterTag, marginR);
        }

        var popupsCenter = app.main.children('.popup[data-position*="center"]:visible');
        popupsCenter.each(function (index) {
            var $this = $(this);
            $this.css('margin-left', parseInt($this.css('margin-left')) - marginR / 2 + 'px');
        });

        var popupsRight = app.main.children('.popup[data-position*="right"]:visible');
        popupsRight.each(function (index) {
            var $this = $(this);
            $this.css('margin-right', parseInt($this.css('margin-right')) + marginR + 'px');
        });

        if (app.main.hasClass('two-columns') && app.contentHeader.length && app.contentHeader.css('position') === 'fixed') {
            app.contentHeader.addClass('no-transitions').css('width', app.contentHeader.outerWidth() + -marginR / 2 + 'px');
        }
        app.htmlOverflowEnabled = false;
    }
};

app.enableHtmlScroll = function () {
    if (!app.htmlOverflowEnabled) {
        app.html.css('overflow', app.html.data('previous-overflow'));
        var scrollPosition = app.html.data('scroll-position');
        window.scrollTo(scrollPosition[0], scrollPosition[1]);

        app.body.removeAttr('style');
        app.header.removeAttr('style');
        app.right.removeAttr('style');
        app.footer.removeAttr('style');
        var popups = app.main.children('.popup');
        if (popups.length) {
            popups.removeAttr('style');
        }
        if (app.contentHeader.length) {
            app.contentHeader.removeClass('no-transitions').removeAttr('style');
        }
        app.htmlOverflowEnabled = true;
    }
};

app.setHtmlOverflow = function () {
    if (!app.main.hasClass('loading') && !app.htmlOverflowEnabled && (!app.isSmallBreakpoint() || app.isSmallBreakpoint() && !app.main.hasClass('left-open') && !app.main.hasClass('right-open'))) {
            app.enableHtmlScroll();
    } else if (app.isSmallBreakpoint() && app.htmlOverflowEnabled && (app.main.hasClass('left-open') || app.main.hasClass('right-open'))) {
        app.disableHtmlScroll();
    }
}

app.showLoading = function () {
    app.disableHtmlScroll();
    app.body.addClass('loading');
};

app.hideLoading = function () {
    app.body.removeClass('loading');
    app.setHtmlOverflow();
    //if (!(app.isSmallBreakpoint() && !app.main.hasClass('left-open')) && !(app.isSmallBreakpoint() && !app.main.hasClass('right-open'))) {
    //    app.enableHtmlScroll();
    //}
};

$(function () {
    app.body.on('click', '.toggle-loading', function () {
        app.showLoading();
        setTimeout(function () {
            app.hideLoading();
        }, 2000);
    });
});
var app = app || {};
app.localStorage = typeof Storage !== "undefined";
app.settings = [];

app.applySettings = function (id, type, value, set) {
    if (app.localStorage && set) {
        var entry = {
            "id": id,
            "type": type,
            "value": value
        };
        var exists = $.grep(app.settings, function (e) { return e.id === id; });
        if (exists.length === 0) {
            // not found
            app.settings.push(entry);
        } else if (exists.length === 1) {
            // found
            exists[0].value = value;
        }
        localStorage.setItem('settings', JSON.stringify(app.settings));
    } else {
        if (type === "checkbox") {
            $('#settings').find('#' + id).prop('checked', value);
        } else if (type === "slider") {
            $('#settings').find('#' + id).slider('setValue', value);
        }
    }

    if (type === 'checkbox') {
        if (value) {
            app.main.addClass(id);
        } else {
            app.main.removeClass(id);
        }
    } else if (id === 'font-size') {
        if (app.main.hasClass('transitions')) {
            app.main.removeClass('transitions');
            app.html.css('font-size', value + 'px');
            setTimeout(function () {
                app.main.addClass('transitions');
            }, 500);

        } else {
            app.html.css('font-size', value + 'px');
        }
    }
};

$(function () {
    app.right.load('ajax/layout/settings.html', function () {
        var $this = $(this);
        if (app.localStorage) {
            app.settings = JSON.parse(localStorage.getItem("settings"));
            if (app.settings === null) app.settings = [];
        }

        $this.find('#font-size').slider({
            min: 12,
            max: 20,
            step: 2,
            value: 16,
            tooltip: "hide"
        }).on('change', function () {
            var $this = $(this);
            var id = $this.attr('id');
            var type = "slider";
            var value = $this.slider('getValue');
            app.applySettings(id, type, value, true);
        });

        $this.on('click', 'input[type=checkbox]', function () {
            var $this = $(this);
            var id = $this.attr('id');
            var type = "checkbox";
            var value = $this.is(':checked');
            app.applySettings(id, type, value, true);
            if (id === 'two-columns') {
                app.checkGoogleMaps();
            }
        });

        if (app.localStorage) {
            $.each(app.settings, function (i, entry) {
                app.applySettings(entry.id, entry.type, entry.value, false);
            });
        }

        $(window).click(function (e) {
            if (app.main.hasClass('close-left-click-outside') || app.main.hasClass('close-right-click-outside')) {
                var target = $(e.target);
                if (!target.closest("#loading").length && !target.closest(".aside").length && !target.closest('.popup').length) {
                    if (app.main.hasClass('left-open') && app.main.hasClass('close-left-click-outside') && !target.closest("#left").length) {
                        app.enableHtmlScroll();
                        app.main.removeClass('left-open');
                    } else if (app.main.hasClass('right-open') && app.main.hasClass('close-right-click-outside') && !target.closest("#right").length) {
                        app.enableHtmlScroll();
                        app.main.removeClass('right-open');
                    }
                    app.checkGoogleMaps();
                }
            }
        });
    });
});